import {
  FadedBackround,
  Header,
  Input,
  InputContainer,
  Label,
  Window,
} from "./Styles";

const AddModal = () => {
  return (
    <>
      <Window>
        <Header>New Employee</Header>
        <InputContainer>
          <Label>First Name</Label>
          <Input />
          <Label>Last Name</Label>
          <Input />
          Email
          <Input />
          Role
          <Input />
          Age
          <Input />
        </InputContainer>
      </Window>
      <FadedBackround />
    </>
  );
};

export default AddModal;
